sourcesContent:
import userService from '../service/userService'
let postRegister = async (req, res) => {
    try {

        if (!req.body.email && !req.body.phoneNumber && !req.body.userName && !req.body.password) {
            return res.status(200).json({
                EM: 'missign requeir params',
                EC: 1,
                DT: ''
            })
        }
        let data = await userService.createRegisterUser(req.body)
        return res.status(200).json({
            EM: data.EM,
            EC: data.EC,
            DT: ''
        })
    } catch (e) {
        console.log(e)
        return res.status(500).json({
            EM: 'erro from sever',
            EC: -1,
            DT: ''

        })

    }

}
let getGender = async (req, res) => {
    try {

        let data = await userService.getGender()
        if (data) {
            return res.status(200).json({
                EM: 'get gender success',
                EC: 0,
                DT: data
            })
        }
        else {
            return res.status(200).json({
                EM: data.EM,
                EC: data.EC,
                DT: ''
            })
        }



    } catch (e) {
        console.log(e)
        return res.status(500).json({
            EM: 'erro from sever',
            EC: -2,
            DT: ''

        })

    }

}
module.exports = {
    postRegister, getGender
}

