import bcrypt from 'bcryptjs';
import db from '../models/index';

const checkemailIsExit = async (email) => {
    let data = await db.User.findOne({ where: { email: email } })
    if (data) {
        return false
    }
    else
        if (!data) {
            return true
        }
}
const hashUserPassword = (password) => {
    let hashpassword = bcrypt.hashSync(password, salt)
    return hashpassword

}
const checkPassword = (password, hashPassword) => {
    return bcrypt.compareSync(password, hashPassword);
}
const getGender = async (data) => {
    try {


        return {
            EM: `create success role`,
            EC: 0,
            DT: ''
        }

    } catch (e) {
        console.log(e)
        return {
            EM: 'SOMTHING WRONG',
            EC: -1,
            DT: []
        }
    }

}
const createRegisterUser = async (rawUserData) => {
    let checkMail = await checkemailIsExit(rawUserData.email)


    let hashPassword = hashUserPassword(rawUserData.password)
    let data = {}
    try {
        if (checkMail) {
            data = await db.User.create({
                userName: rawUserData.userName,
                password: hashPassword,
                email: rawUserData.email,
                phone: rawUserData.phone,
                gender: rawUserData.gender,
                address: rawUserData.address,
                groupId: 1,



            })
            data.EM = 'create user success'
            data.EC = 0
        }
        else {
            data.EM = 'your email or phone number hax been user'
            data.EC = 2
        }

    } catch (e) {
        console.log(e)
        data.EM = 'somthing wropng'
        data.EC = -1
    }
    return data
}

module.exports = {
    createRegisterUser, getGender
}

