        nameCar: DataTypes.STRING,

        carCompanyId: DataTypes.INTEGER,
        avata: DataTypes.BLOB('long'),
        descriptions: DataTypes.STRING,

    }, {
        sequelize,
        modelName: 'Car',
        freezeTableName: true
    });
    return Car;
};

