        }

    } catch (e) {
        console.log(e)
        return res.status(500).json({
            EM: 'erro from sever',
            EC: -1,
            DT: ''

        })
    }

}
let readDeatailGara = async (req, res) => {
    try {
        console.log('chcek reqasdasd: ', req.params.id)
