            let id = req.params.id;

            let data = await AdminService.getGaraWithId(id)
            return res.status(200).json({
                EM: data.EM,
                EC: data.EC,
                DT: data.DT
            })
        }
        else {

            return res.status(200).json({
                EM: 'you dont pass the id',
